import React from 'react';
import NavigationButtons from './NavButtons';
import AssessmentContent from './AssessmentContent';
import CheckboxField from './CheckboxField';
import { List, ListSubheader, ListItemButton, ListItemIcon, StarBorder, ListItemText, Divider } from '@mui/material';


const Step2 = ({ prevStep, nextStep }) => {
    return (
        <React.Fragment>
            <AssessmentContent
                title="Delivering working, tested software every 3 weeks or less"
                prevStep={prevStep}
                nextStep={nextStep}>
                <List sx={{ width: '100%', maxWidth: 1024, bgcolor: 'background.paper' }}>
                    <h2>Timeboxed Iterations</h2>
                    <CheckboxField name="iterations" label="Timeboxed Iterations" />
                    <ListSubheader component="div" id="nested-list-subheader">
                    </ListSubheader>
                    <List component="div" disablePadding>
                        <ListItemButton sx={{ pl: 4 }}>
                            <ListItemIcon>
                                <Divider />
                            </ListItemIcon>
                            <ListItemText primary="Starred" />
                            <CheckboxField name="endOnTime" label="Always end on time" />
                            <CheckboxField name="undisturbed" label="Team not disrupted or controlled by outsiders" />

                        </ListItemButton>
                    </List>

                </List>
            </AssessmentContent>

            <NavigationButtons prevStep={prevStep} nextStep={nextStep} />
        </React.Fragment>
    );
};

export default Step2;
